import React, { Component } from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import UnrecognizedTable from './unrecognizedTable'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  chart: {
      width: '125%',
      height: '325px'
  },
  heatmap: {
      padding: theme.spacing(2),
      width: '75%',
      marginLeft: '25%',
      height: '310px'
  },
  timePlot: {
    marginTop: '30px',
    padding: theme.spacing(2),
    width: '75%',
    marginLeft: '25%',
    height: '310px'
  }
}));

class MyGrid extends Component {

  render(){
  const {classes} = this.props;

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={6}>
          <Paper className={classes.chart}>
              <UnrecognizedTable/>
          </Paper>
        </Grid>
        <Grid item xs={6}>
          <Paper className={classes.heatmap} style={{backgroundColor: '#E5E5E5'}}>
              Chart showing the areas with the most unrecognized plate
          </Paper>
          <Paper className={classes.timePlot} style={{backgroundColor: '#E5E5E5'}}>
              Chart showing activity over time
          </Paper>
        </Grid>
      </Grid>
    </div>
  )};
}

export default withStyles(useStyles)(MyGrid)
